import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 6.2-2103 Registration fees; reports.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/6.2-2103.md","filePath":"vacode/6.2-2103.md"}'),i={name:"vacode/6.2-2103.md"},o=a('<h1 id="§-6-2-2103-registration-fees-reports" tabindex="-1">§ 6.2-2103 Registration fees; reports. <a class="header-anchor" href="#§-6-2-2103-registration-fees-reports" aria-label="Permalink to &quot;§ 6.2-2103 Registration fees; reports.&quot;">​</a></h1><p>A. Each registration form shall be accompanied by payment of a $200 fee, which shall not be refundable or abated in any event.</p><p>B. To defray the costs of their examination, supervision and regulation, check cashers required to be registered under this chapter shall pay to the Commission annually on or before July 1 a registration fee in an amount prescribed by the Commission, but not exceeding $250.</p><p>C. All fees shall be paid into the state treasury and credited to the &quot;Financial Institutions Special Fund -- State Corporation Commission.&quot;</p><p>D. Every check casher required to be registered under this chapter shall file such annual or other reports as the Commission may prescribe.</p><p>1995, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0221" target="_blank" rel="noreferrer">221</a>, § 6.1-435; 1999, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0529" target="_blank" rel="noreferrer">529</a>; 2010, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0794" target="_blank" rel="noreferrer">794</a>.</p>',6),s=[o];function n(c,l,p,h,d,f){return t(),r("div",null,s)}const g=e(i,[["render",n]]);export{u as __pageData,g as default};
